import { React, Component } from "react";
import Slider from "react-slick";
import './style.css'
import pic from './images/hpi2.jpg'
import pic1 from './images/hpi3.webp'
import pic2 from './images/hpi4.webp'



const Home = () => {
   
        return (
            
            <div style={{ paddingTop: '70px'}}>
               
                 <img src={ pic } style={{width: '1500px', height: '600px', borderRadius:'200px'}}/> 
                
                
                <div class="col  mb-2" style={{display: 'flex', flexDirection: 'row', paddingTop: '70px'}}>
                    <img class="inner-img" src={ pic1 } style={{width: '500px', height: '300px', paddingLeft: '30px', borderRadius: '20px', borderColor: 'whitesmoke'}}/>
                    &nbsp; &nbsp; 
                    <img class="inner-img" src={ pic2 } align="right"/>
                </div>
               
                
            </div>
            
        )
}
    
     
    export default Home;
